css:
.sheet-toolbar {
  border-bottom: none;
  box-shadow: 0 0 0.5px #313236, 0 1px 1.5px #313236, 0 0 3px #313236;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  -webkit-filter: invert(100%);
}
img.content-dark {
  -webkit-filter: invert(100%);
}
img.content-light {
  -webkit-filter: invert(100%);
}
.popover {
  border: 1px solid #313236;
}
.mail-label {
  -webkit-filter: contrast(110%) brightness(85%);
}
.selected-items-stack {
  display: flex;
  align-self: center;
  align-items: center;
  height: 100%;
}
.selected-items-stack .selected-items-stack-content {
  display: flex;
  position: relative;
  align-items: center;
  justify-content: center;
  width: 198px;
  height: 268px;
}
.selected-items-stack .selected-items-stack-content .stack .card {
  position: absolute;
  top: 0;
  left: 0;
  width: 198px;
  height: 268px;
  background: url("../internal_packages/thread-list/assets/graphic-stackable-card-filled.svg");
  background-size: 198px 268px;
}
.selected-items-stack .selected-items-stack-content .count-info {
  display: flex;
  flex-direction: column;
  align-items: center;
  z-index: 6;
}
.selected-items-stack .selected-items-stack-content .count-info .count {
  font-size: 4em;
  font-weight: 200;
  color: rgba(192, 198, 203, 0.6);
}
.selected-items-stack .selected-items-stack-content .count-info .count-message {
  padding-top: 5px;
  color: rgba(192, 198, 203, 0.6);
}
.selected-items-stack .selected-items-stack-content .count-info .clear.btn {
  margin-top: 18px;
}
